import React from 'react';
import github from '../img/github.png';
import linkedin from '../img/linkedin.png';

const Footer = () => {
  return (
    <div className="Footer">
      <div>
        <a href="https://github.com/martham0">
          <img src={github} alt="Github" width="50x"></img>
        </a>
        <a href="https://www.linkedin.com/in/mmartham/">
          <img src={linkedin} alt="Linkedin" width="50px"></img>
        </a>
      </div>
      <div>
        <a src="https://github.com/martham0/me">
          {' '}
          <p>Create by Martha Martinez</p>
        </a>
      </div>
    </div>
  );
};

export default Footer;
